import React from 'react';
import './Project.css';
import secondProjectImage from '../../images/SecondProjectImage.jpg'; // Replace with the actual path

const SecondProject = () => {
  const deployLink = "https://your-second-project-url.com";
  const githubLink = "https://github.com/yourusername/your-second-project-repo";
  const title = "Second Project";

  return (
    <div className="project">
      <img src={secondProjectImage} alt={`${title} Preview`} />
      <h3>{title}</h3>
      <a href={deployLink} target="_blank" rel="noopener noreferrer">
        Deployed App
      </a>
      <a href={githubLink} target="_blank" rel="noopener noreferrer">
        GitHub Repository
      </a>
    </div>
  );
};

export default SecondProject;
